#pragma mark - Stack
//Implement the following operations of a stack using queues.
//
//push(x) -- Push element x onto stack.
//pop() -- Removes the element on top of the stack.
//top() -- Get the top element.
//empty() -- Return whether the stack is empty.
//Notes:
//You must use only standard operations of a queue -- which means only push to back, peek/pop from front, size, and is empty operations are valid.
//Depending on your language, queue may not be supported natively. You may simulate a queue by using a list or deque (double-ended queue), as long as you use only standard operations of a queue.
//You may assume that all operations are valid (for example, no pop or top operations will be called on an empty stack).
//Update (2015-06-11):
//The class name of the Java function had been updated to MyStack instead of Stack.
class Stack {
public:
    // Push element x onto stack.
    void push(int x) {
        m_queue.push(x);
    }

    // Removes the element on top of the stack.
    void pop() {
        queue<int> newQueue;
        while( m_queue.size() > 1 )
        {
            newQueue.push(m_queue.front());
            m_queue.pop();
        }
        m_queue = std::move( newQueue );
    }

    // Get the top element.
    int top() {
        return m_queue.back();
    }

    // Return whether the stack is empty.
    bool empty() {
        return m_queue.empty();
    }
private:
    queue<int> m_queue;
};

#pragma mark - invertTree
//Invert a binary tree.
//
//     4
//   /   \
//  2     7
// / \   / \
//1   3 6   9
//to
//     4
//   /   \
//  7     2
// / \   / \
//9   6 3   1
TreeNode* invertTree(TreeNode* root)
{
    if( root == nullptr )   return root;

    queue<TreeNode*> q;
    q.push(root);
    while( !q.empty() )
    {
        size_t s = q.size();
        size_t i = 0;
        while( i++ < s )
        {
            TreeNode* n = q.front();
            q.pop();
            if( n->left != nullptr )    q.push(n->left);
            if( n->right != nullptr )   q.push(n->right);
            
            swap( n->left, n->right );
        }
    }
    
    return root;
}

#pragma mark - calculate2
//Implement a basic calculator to evaluate a simple expression string.
//
//The expression string contains only non-negative integers, +, -, *, / operators and empty spaces . The integer division should truncate toward zero.
//
//You may assume that the given expression is always valid.
//
//Some examples:
//"3+2*2" = 7
//" 3/2 " = 1
//" 3+5 / 2 " = 5
void getNextActionable( string s, size_t& start, char& op, long& number)
{
    while (s[start] == ' ' ) { start++; }
    
    if( start >= s.size() )
    {
        op = 'E';
        return;
    }
    
    if( s[start] == '+' || s[start] == '-' || s[start] == '*' || s[start] == '/' )
    {
        op = s[start];
        start++;
    }
    else
    {
        number = 0;
        while( start < s.size() && s[start] >= '0' && s[start] <= '9' )
        {
            number = number * 10 + (s[start] - '0');
            start++;
        }
    }
}

void calculateAddMinusFromStack(stack<long>& numbers, stack<char>& ops )
{
    char topOp = 'N';
    if( !ops.empty() )  topOp = ops.top();
    
    if( topOp == '+' || topOp == '-' )
    {
        long right = numbers.top();
        numbers.pop();
        long left = numbers.top();
        numbers.pop();
        
        long r = topOp == '+' ? left + right : left - right;
        numbers.push(r);
        
        ops.pop();
    }
}

int calculate2(string s)
{
    stack<long> numbers;
    stack<char> ops;
    size_t start = 0;
    while( true )
    {
        char op='&';
        long number = 0;
        getNextActionable(s, start, op, number);
        if( op == 'E' )
        {
            break;
        }
        else if( op == '+' || op == '-' )
        {
            calculateAddMinusFromStack( numbers, ops );
            
            ops.push(op);
        }
        else if( op == '*' || op == '/' )
        {
            char dummyOp;
            long right = 0;
            getNextActionable(s, start, dummyOp, right);
            
            long left = numbers.top();
            long r = op == '*' ? left * right : left / right;
            
            numbers.pop();
            numbers.push(r);
        }
        else
        {
            numbers.push(number);
        }
    }
    
    calculateAddMinusFromStack( numbers, ops );
    
    return numbers.empty() ? 0 : (int)numbers.top();
}

